import { Grid, Typography } from "@mui/material";
import { Box } from "@mui/system";
import React from "react";
import ArrowForwardIosIcon from '@mui/icons-material/ArrowForwardIos';

function Designer(){

    return(
        <Box>
            <Box sx={{display:'flex' , alignItems:'center', justifyContent:'center' , mt:7 , width:'70%', marginX:'auto' , borderBottom:3 , borderColor:'lightgray' , pb:2 , mb:7}}>
                <Typography>상품 카테고리 선택</Typography>
                <ArrowForwardIosIcon fontSize="small" sx={{mx:4, color:'gray'}}/>
                <Typography sx={{color:'gray'}}>상품 디자인 업로드</Typography>
            </Box>
            <Grid container>
                <Grid item sx={{borderTop:1}}>

                </Grid>
            </Grid>
        </Box>
    );
}

export default Designer;
